import { Col, Row, Container } from "reactstrap";
import "./Thankyou.css";
import './Mybooking.css'

import CommonSection from "../components/Shared/CommonSection";
import "../style/tour.css";
import Tourcard from "../components/Shared/Tourcard";
import Searchbar from "../components/Shared/Searchbar/Searchbar";
import Newsletter from "../components/Shared/Newsletter";

import useFetch from "../hooks/useFetch";
import { BASE_URL } from "../Utilis/config";

const Mybooking = () => { 

const { data: books, loading, error } = useFetch(`${BASE_URL}/booking`);

    return (
    <>
      {/* Title  */}
      <CommonSection title={"All Bookings"} />

      {/* SearchBar  */}
      <section>
        <Container>
          <Row>
            <div className="search-bar">
              <Searchbar />
            </div>
          </Row>
        </Container>
      </section>
     
  {/* Loading && error  */}
  
      {/* <section className="pt-0">
     
        <Container>
          {loading && <h4 className="text-center pt-05">Loading....</h4>}  
          {error && <h4 className="text-center pt-05">{error}</h4>}        

          {!loading &&  !error && (
            <Row>
                
              {books?.map((book) => (                       
                <Col lg="3" className="mb-4" key={book.id}>
                  <Tourcard book={book} />
                </Col>
              ))}
            </Row>
          )}
        </Container>
      </section> */}

      {/* Newsletter */}
      <div className="nz">
        <Newsletter />
      </div>
    </>
  );
};

